import React from 'react';
import {Link} from "react-router-dom";

const Cabinet = () => {
    return (
        <>
            <div className={"container"}>
                <h2 className={"text-center display-6 mt-2"}>Personal Account</h2>
                <p className={"text-decoration-underline text-center"}><Link to={"SignOut"}>Sign Out</Link></p>
            </div>
            <div className={"container"}>
                
            </div>
        </>
    );
};

export default Cabinet;
